import React from 'react';
import { useNavigate } from 'react-router-dom';

function FlightCard() {
  const navigate = useNavigate();

  const handleClick = (e) => {
    e.preventDefault()
    navigate('/services/CategoryService'); //  Navigates to FlightService page
  };

  return (
    <>
      <div className="card" style={{ width: '18rem' }}>
        <img src="/Woman.jpg" className="card-img-top" alt="Woman" />
        <div className="card-body">
          <h5 className="card-title">Explore Flights</h5>
          <p className="card-text">Find the best flights for your next adventure.</p>
          <button className="btn btn-primary" onClick={handleClick}>
            Flights
          </button>
        </div>
      </div>
    </>
  );
}

export default FlightCard;
